                 './username-rihanna.json', './username-twitterdev.json'];

const listItems = myUsernames.map((username) =>

    <div key={username}>{username}</div>
);

let data = myUsernames.map(username => require({username}));

ReactDOM.render(
    <div>{listItems}</div>,
    document.getElementById('root')
);
